import { Button, View, Text, TouchableOpacity } from "react-native";

export default function InterruptScreen({ navigation }) {
  return (
    <View className="flex-1 items-center justify-center bg-black">
      <Text className="text-white">
        Una delle soluzioni per evitare che si verifichino deadlock, starvation
        o altri problemi è la disabilitazioni degli interrupt, quando un
        programma entra nella sezione critica nessun processo potrà "rubare" il
        processore, cosicché il processo potrà finire la sua sessione critica
      </Text>
    </View>
  );
}
